import React from 'react';
// Import Link
import { Link } from 'react-router-dom';

// Dummy component
const MyNav = props => {
	return (
		<nav>
			<ul style={styles.myNav}>
				<li style={styles.navListItems}>
					<Link to="/" style={styles.navLinks}>
						Icon here - Dashboard
					</Link>
					{/* <button style={styles.navLinks}>News Feed</button> */}
				</li>
				<li style={styles.navListItems}>
					<Link to="/" style={styles.navLinks}>
						Icon here - Reports
					</Link>
				</li>
				<li style={styles.navListItems}>
					<Link to="/" style={styles.navLinks}>
						Icon here - Income
					</Link>
				</li>
				<li style={styles.navListItems}>
					<Link to="/" style={styles.navLinks}>
						Icon here - Savings
					</Link>
				</li>
				<li style={styles.navListItems}>
					<Link to="/" style={styles.navLinks}>
						Icon here - Spending
					</Link>
				</li>
			</ul>
		</nav>
	);
};

// Export
export default MyNav;

// Styling
const styles = {
	myNav: {
		listStyle: 'none',
		padding: 0,
		margin: '20px',
	},
	navListItems: {
		margin: '10px',
	},
	navLinks: {
		backgroundColor: '#7B89A6',
		padding: '10px',
		color: '#000',
		width: '100%',
		// textDecoration: 'none',
		// display: 'block',
		// margin: '20px',
		border: 'none',
		cursor: 'pointer',
	},
};
